import React from 'react';
import './Nav.scss';
import { Link } from 'react-router-dom';

 function Navbar() {
  return (
<nav>
  <div>
     GoodWorm Gardens
  </div>
  <ul>
    <li><Link to = '/'>Home</Link></li>
    <li><Link to = '/connect yards'>Connect yards</Link></li>
    <li><Link to = '/gardening guide'>Gardening guide</Link></li>
    <li><Link to = '/coordinators'>Coordinators</Link></li>
    <li><Link to = '/contact us'>Contact us</Link></li>
    </ul>
</nav>
  )
}
export default Navbar;
